    /// @param takerToken Address of the taker token.
    function _assertValidPair(address makerToken, address takerToken)
        internal
        pure
    {
        require(makerToken != takerToken, "ERC20BridgeSampler/INVALID_TOKEN_PAIR");
    }
}

